import io from "socket.io-client";
import * as config__ from "./../config";
interface config {
  URI_Scheme: string,
  host:string,
  port:string,
}
export class SocketIOClient{
  socket = io(config__.HOST);
  demoOn = () =>{
    this.socket.on('data-vn', (data:any) => {console.log("VN",JSON.data)});
    this.socket.on('data-global', (data:any) => {console.log("GLO",data)});
    this.socket.on('data-all', (data:any) => {console.log("ALL",data)});
    this.socket.on('data-location', (data:any) => {console.log("LOCATION",data)});
  }

  demoEmit = ()=>{
    this.socket.emit('',()=>{
      console.log("EMIT_CLIENT")
    })
  }
}
